import React from "react";

class UPLoad extends React.Component{
    state={
        fileList:[]
    }

    render() {
        return (
            <div>
                <label>
                    上传的文件：
                    <input type="file"/>
                </label>
                <button>上传</button>
            </div>
        )
    }
}

export default UPLoad;
